import React, { useEffect } from 'react'
import requests from '../../services/requests'
import './converter.scss'

function Converter() {
	useEffect(() => {
		requests
			.getCurrencyValue('uah', 'usd')
			.then(data => {
				console.log(data)
			})
			.catch(error => {
				console.error('Error fetching currency rates:', error)
			})
	}, [])

	return <div></div>
}

export default Converter
